const ItemDetail = ({product}) => {
    return(
        <div className="ItemDetailStyle">
            <p>{product?.name}</p>
            <p>{product?.color}</p>
            <img src = {product?.img}/>
            <br></br>
            <p>{product[2].name}</p>
            <p>{product[2].color}</p>
            <img src = {product[2].img}/>
            <br></br>
        </div>
    );
};

export default ItemDetail;
